post_text:
NYS COVID-19 UPDATE

NYS Homes and Community Renewal (HCR) will open the Rent Relief Program application period today (Thursday, July 16) and it will be open for only 2 weeks.

To qualify, applicants must have:
Primary residence in New York State;
Income below 80% Area Median Income;
Experienced a rent burden, defined as paying more than 30% of gross monthly income towards rent;
Lost income during any period between April 1, 2020 and July 31, 2020;
Rent not greater than 125% of Fair Market Rent; and,
At least one household member must be a U.S. citizen or meet one of the immigration criteria found here.
[Households living in public housing or in receipt of Section 8 housing assistance are not eligible for RRP.]

For more information, visit: https://hcr.ny.gov/RRP.

